import React from 'react'
import { ServicesContainer, ServicesH1, ServicesWrapper, ServicesCard,
    ServicesIcon, ServicesH2, ServicesP} from './AboutElements';
import Textbox from '../../images/about-textbox.svg'



const AboutSection = () => {
    return (
        <ServicesContainer id="services">
            <ServicesH1>Bluedot</ServicesH1>
            <ServicesWrapper>
                <ServicesCard src={Textbox}>
                    {/* <ServicesIcon /> */}
                    <ServicesH2>Reduce expenses</ServicesH2>
                    <ServicesP>We Help reduce your fees and increase your overall revenue.</ServicesP>
                </ServicesCard>
                <ServicesCard src={Textbox}>
                    {/* <ServicesIcon /> */}
                    <ServicesH2>Virtual Profile</ServicesH2>
                    <ServicesP>You can build your brand with our platform online.</ServicesP>
                </ServicesCard>
                <ServicesCard src={Textbox}>
                    {/* <ServicesIcon /> */}
                    <ServicesH2>Premiun Benefits</ServicesH2>
                    <ServicesP>Unlock our special membership card that returns 5% cash back.</ServicesP>
                </ServicesCard>

            </ServicesWrapper>
        </ServicesContainer>
    )
}

export default AboutSection
